        public static CollationInfo GetByCollationId(int collationId)
        {
            if (collationId == 0)
                return _defaultCollation;

            if(!_collations.TryGetValue(collationId, out CollationInfo collInfo))
                return _defaultCollation;

            return collInfo;
        }

        public static CollationInfo GetCollationForColumn(Column column)
        {
            return GetCollationForColumn(column.SystemTypeID, column.UserTypeID, column.CollationId);
        }

        public static CollationInfo GetCollationForColumn(byte sytemTypeId, int userTypeId, int collationId)
        {
            if (new[] { SystemType.Char, SystemType.Varchar, SystemType.Nchar, SystemType.Nvarchar }.Intersect(new[] { (SystemType)sytemTypeId, (SystemType)userTypeId }).Any())
            {
                return GetByCollationId(collationId);
            }

            return null;
        }

        public static Encoding GetEncodingForCollationId(int collationId)
        {
            var collation = GetByCollationId(collationId);

            return GetEncodingForCollation(collation);
        }

        public static Encoding GetEncodingForColumn(Column column)
        {
            var collation = GetCollationForColumn(column);

            if(collation != null)
                return GetEncodingForCollation(collation);

            return null;
        }

        public static string GetCollationNameForColumn(byte sytemTypeId, int userTypeId, int collationId)
        {
           return GetCollationForColumn(sytemTypeId, userTypeId, collationId)?.Name;
        }

        public static Encoding GetEncodingForCollation(CollationInfo collation)
        {
            return Encoding.GetEncoding(new CultureInfo(collation.Lcid).TextInfo.ANSICodePage);
        }
    }

    public class CollationInfo
    {
        public string Name { get; set; }
        public int Lcid { get; set; }
        public long TdsCollation { get; set; }
    }
